import { Container, Row, Col } from "react-bootstrap";

const Calendar = () => {
    const weekDays =["Monday","Tuesday","Wednesday","Thursday","Friday","Saturday", "Sunday"]
    const weekInMonth = [0,1,2,3,4,5];

    const takie = () =>  {weekInMonth.map(week => 
        <Row id={week.toString()} md="auto">
                {week === 0 ? "day" : "TAKI"}
        </Row>
    )}

    return(
        <Container fluid>
            <Row>
                {weekDays.map(day => 
                    <Col id={weekDays.indexOf(day).toString()} md="auto">
                        {day}
                    </Col>
                )
            }   
            </Row>
        </Container>
    );
};

export default Calendar;
